import React, { Component } from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";


import HomeAdmin from "../components/HomeAdmin";

import Avatar from "../assets/imgs/avatar-admin.png";
import Logo from "../assets/imgs/logo.png";

export default class Dashboard extends Component {

  constructor(props) {
    super(props);
    this.state = {
      avatar: Avatar
    }
  }

  render() {
    return (
      <div>
        <Router>
          <body className="aside-active dashboard home">
            <main>
              <div className="flex">
                <div className="menu">

                  <div className="flex flex-column flex-center admin-infos">
                      <Link to="/">
                          <img src={this.state.avatar} alt="NetGift" width="150" />
                      </Link>
                      <div className="flex flex-center admin-info">
                          <img src={this.state.avatar} alt="" />
                          <div className="flex flex-column">
                              <p>Ol√°, Rafael B.</p>
                              <small>Administrador</small>
                          </div>
                      </div>
                  </div>

                </div>
              </div>
            </main>
          </body>
            <Route path="/dashboard/home" exact component={HomeAdmin} />
        </Router>
      </div>
    );
  }
}
